import React, { useState } from 'react';

const Joke = () => {


    const [joke,setJoke] = useState("sadsa")

    const fetchJoke = () => {
        fetch("https://api.chucknorris.io/jokes/random")
        .then(res => res.json())
        .then(data => {
           setJoke(data.value);
        });
    }

    return (
        <div>
            <p>{joke}</p>
            <button onClick={fetchJoke}>Get Chuck Norris Joke</button>
        </div>
    )
}

export default Joke;
